import React from "react";
import { useSelector } from "react-redux";

const ProductComponent = () => {
    const products = useSelector((state) => state);
    return (
        <div className="four column wide">
            <h1>
                Product Component
            </h1>
        </div>
    )
};

export default ProductComponent;
